import React,{Component} from "react";

class Status extends Component
{
    render()
    {
        return(

            <div className=" page-holder bg-cover" style={{backgroundColor:'#FFE4E1'}}>
                <header className="text-center text-grey py-5">
                    <div style={{backgroundColor:'white'}}>
                    <h1 className="font-weight-bold">Block / Unblock Wallets</h1>
                    </div>
                </header>
            </div>
        )
    }
}

export default Status;
